import axios from "axios"

export const ApiPost = (name, email, password) => {
	const update = {
		username: name,
		email: email,
		password: password,
	};

	const options = {
		method: 'POST',
		headers: {
			'Content-Type': 'application/json',
		},
		body: JSON.stringify(update),
	};
	axios
		.post('localhost:8081', options)
		.then(encoded => encoded.json())
		.then(response => response)
		return(response)

}
